import { Card, CardContent, TextField } from "@material-ui/core";
import { Field, Form, Formik, FormikConfig, FormikValues } from "formik";
import { CheckboxWithLabel } from "formik-material-ui";
import React from "react";

export const FormDisplay = () => {
  return (
    <div>
      <Card>
        <CardContent>
          <FormikStepper
            initialValues={{
              firstname: "",
              lastname: "",
              age: "",
              email: "",
              password: "",
              male: false,
              female: false,
              contact: "",
              description: "",
            }}
            onSubmit={async (values) => {
              console.log("values", values);
            }}
          >
            <Form>
              <Field
                type="text"
                label="First Name"
                name="firstname"
                component={TextField}
              />
              <Field
                type="text"
                label="Last Name"
                name="lastname"
                component={TextField}
              />
              <Field
                type="number"
                label="Age"
                name="age"
                component={TextField}
              />
              <Field
                type="text"
                label="Email"
                name="email"
                component={TextField}
              />
              <Field
                type="text"
                label="Password"
                name="password"
                component={TextField}
              />
              <Field
                type="checkbox"
                Label={{ label: "Female" }}
                name=" female"
                component={CheckboxWithLabel}
              />
              <Field
                type="checkbox"
                Label={{ label: "Male" }}
                name="male"
                component={CheckboxWithLabel}
              />
              <Field
                type="number"
                label="Contact"
                name="contact"
                component={TextField}
              />
              <Field
                type="text"
                label="Description"
                name="description"
                component={TextField}
              />
            </Form>
          </FormikStepper>
        </CardContent>
      </Card>
    </div>
  );
};

export const FormikStepper = ({
     children,
      ...props 
    }: FormikConfig<FormikValues>) => {
return(

    <Formik {...props}>
        <Form>
            {children}
        </Form>

    </Formik>
)

};
